    const onLogOut = useCallback(() => {
        setIsLoggedIn(false)
    }, []);


    return (
        <Card
            actions={[
                <div key='twit'>짹짹<br /></div>,
                <div key='followings'>팔로잉<br /></div>,
                <div key='followers'>팔로워<br /></div>
            ]}
        >
            <Card.Meta
                avatar={<Avatar>SB</Avatar>}
                title='subin'
            />
            <Button>로그아웃</Button>
        </Card>
    )
}

